import React, { useState } from 'react';
import Login from './components/Login';

function App() {
  const [userId, setUserId] = useState(null);

  return (
    <div>
      <h1>Bankovní aplikace</h1>
      {!userId ? (
        <Login onLogin={setUserId} />
      ) : (
        <p>Přihlášení proběhlo úspěšně!</p>
      )}
    </div>
  );
}

export default App;
